(12354796, 'Mumbai Family Tour Package', 'Mumbai', 'Family', 5, '4.5', '  A fun-filled holiday with your family is the best time to strengthen bonds and rejuvenate the love between dear ones. And, what could be a better place to have a good time with your family members than Mumbai? The pleasant weather, beautiful sceneries and delightful food is sure to put you in your best mood to revel the best time with your family. For a stress-free vacation, you can explore your options for Mumbai family holidays packages.', '09:00', '21:00', 1000, 'Yes', 'No', 'No', 'Yes', 'Yes', 4, 'mumbai-tusktravel-01.jpg'),
(12354797, 'Bangalore Family Tour Package', 'Bangalore', 'family', 4, '3.4', 'A fun-filled holiday with your family is the best time to strengthen bonds and rejuvenate the love between dear ones. And, what could be a better place to have a good time with your family members than Bangalore? The pleasant weather, beautiful sceneries and delightful food is sure to put you in your best mood to revel the best time with your family. For a stress-free vacation, you can explore your options for Bangalore family holidays packages.', '10:00', '20:00', 1000, 'No', 'Yes', 'Yes', 'Yes', 'Yes', 4, 'banglore.jfif'),
(12354798, 'New Delhi Family Tour Package', 'New Delhi', 'Family', 4, '4', 'A fun-filled holiday with your family is the best time to strengthen bonds and rejuvenate the love between dear ones. And, what could be a better place to have a good time with your family members than New delhi? The pleasant weather, beautiful sceneries and delightful food is sure to put you in your best mood to revel the best time with your family.', '15:24', '15:22', 1000, 'Yes', 'Yes', 'Yes', 'Yes', 'Yes', 4, 'njj3r7z3e9tj076iteruxonlk75e_1589034946_india_gate.jpg'),
(12354801, 'Mumbai Honeymoon Tour Package', 'Mumbai', 'Couple', 4, '4', '   What could be a better way to celebrate love and union of two people than with Mumbai honeymoon holidays? The romantic weather and beautiful landscape of this place will perfectly compliment your celebratory mood. You can visit the beautiful tourist attractions and enjoy quality time with your better half with Mumbai honeymoon package.', '08:50', '13:51', 2500, 'Yes', 'Yes', 'Yes', 'Yes', 'Yes', 4, '1590145394_couples.jpg.jpg'),
(12354802, 'Bangalore Honeymoon Tour Package', 'Bangalore', 'Couple', 4, '3.5', 'Popularly known as the Garden City of India, Bangalore is a beautiful place in Karnataka that can be explored during Bangalore honeymoon holidays. The romantic weather and vibrant lifestyle of this city offers the perfect atmosphere for celebrating a new union. Enjoy the effervescent nightlife of this city with your spouse and visit the beautifully manicured gardens that the city is famous for, with Bangalore honeymoon tour package. ', '10:03', '13:03', 1500, 'Yes', 'Yes', 'Yes', 'Yes', 'No', 4, '1590145394_couples.jpg.jpg'),
(12354803, 'New Delhi Honeymoon Tour Package', 'New Delhi', 'Couple', 4, '3', ' What could be a better way to celebrate love and union of two people than with New delhi honeymoon holidays? The romantic weather and beautiful landscape of this place will perfectly compliment your celebratory mood. You can visit the beautiful tourist attractions and enjoy quality time with your better half with New delhi honeymoon packages.', '10:03', '14:03', 2000, 'Yes', 'No', 'Yes', 'Yes', 'Yes', 4, 'Hampta_Pass4.webp'),
(12354804, 'Mumbai Adventure Tour Package', 'Mumbai', 'Solo', 3, '4', 'A visual treat to eyes, the culturally rich India is an apt destination to push your adrenaline rush too. Whether you are looking for adventure holidays amidst snow-dusted mountain peaks or in the sparkling waters, this country offers you the most memorable experience.', '09:39', '13:39', 800, 'No', 'No', 'Yes', 'Yes', 'No', 4, 'Parasailing_over_the_Water.jpg'),
(12354805, 'Bangalore Adventure Tour Package', 'Bangalore', 'Solo', 5, '4.5', 'Bangalore adventure holidays and get set for a lifetime experience that take you to a world of freedom and relaxation. A visual treat to eyes, the culturally rich India is an apt destination to push your adrenaline rush too. Whether you are looking for adventure holidays amidst snow-dusted mountain peaks or in the sparkling waters, this country offers you the most memorable experience. ', '10:50', '14:48', 900, 'Yes', 'No', 'Yes', 'Yes', 'No', 4, 'ynffxxj3ubbpj8rrpaoxb5qyg2wl_1533971096_shutterstock_786919813.jpg'),
(12354806, 'New Delhi Adventure Tour Package', 'New Delhi', 'Solo', 4, '4', 'A visual treat to eyes, the culturally rich India is an apt destination to push your adrenaline rush too. Whether you are looking for adventure holidays amidst snow-dusted mountain peaks or in the sparkling waters, this country offers you the most memorable experience. Among many, New delhi is one destination that you can begin with. New delhi adventure holidays and get set for a lifetime experience that take you to a world of freedom and relaxation.', '11:05', '16:05', 1000, 'No', 'Yes', 'Yes', 'Yes', '', 4, 'sd-cs-1_012116031814.jpg'),
