(12354808, 'Mumbai Family Tour Package', 'Mumbai', 'Family', 4, '3.5', 'A fun-filled holiday with your family is the best time to strengthen bonds and rejuvenate the love between dear ones. And, what could be a better place to have a good time with your family members than Mumbai? The pleasant weather, beautiful sceneries and delightful food is sure to put you in your best mood to revel the best time with your family. For a stress-free vacation, you can explore your options for Mumbai family holidays packages.', '11:31', '14:31', 800, 'Yes', 'No', 'Yes', 'Yes', 'No', 3, 'mumbai-tour-im1.jpg'),
(12354809, 'Bangalore Family Tour Package', 'Bangalore', 'Family', 4, '4', 'A fun-filled holiday with your family is the best time to strengthen bonds and rejuvenate the love between dear ones. And, what could be a better place to have a good time with your family members than Bangalore? The pleasant weather, beautiful sceneries and delightful food is sure to put you in your best mood to revel the best time with your family. For a stress-free vacation, you can explore your options for Bangalore family holidays packages.', '08:30', '05:25', 700, 'Yes', 'No', 'Yes', 'Yes', 'No', 3, '43_10036_Tour_1582027941.jpg'),
(12354810, 'New Delhi Family Tour Package', 'New Delhi', 'Family', 4, '3.5', 'A fun-filled holiday with your family is the best time to strengthen bonds and rejuvenate the love between dear ones. And, what could be a better place to have a good time with your family members than New delhi? The pleasant weather, beautiful sceneries and delightful food is sure to put you in your best mood to revel the best time with your family.', '18:40', '08:40', 1000, 'Yes', 'Yes', 'Yes', 'Yes', 'No', 3, 'download.jpg'),
(12354811, 'Mumbai Beach Tour Package', 'Mumbai', 'Family/Couple/Solo', 5, '4.5', 'If you want to get away from the hustle and bustle of city life and enjoy a break from your everyday tasks, Mumbai beach holidays are the perfect getaway option for you. The picturesque view of turquoise waters lapping over the passive shores and breathtaking sight of the sun setting below the horizon will take away all the stress and rejuvenate you. ', '10:16', '08:16', 1000, 'Yes', 'No', 'Yes', 'Yes', 'Yes', 3, 'download (9).jpg');

